public final class DeliveryMode extends FormRun implements RetailIOperatingUnitPickerCaller
{
}

void enableFields()
{
    boolean     isAccountCodeAndIdEditable;

    isAccountCodeAndIdEditable = dlvMode.allowShipCarrierSetup();
    dlvMode_ds.object(fieldnum(DlvMode, ShipCarrierAccountCode)).allowEdit(isAccountCodeAndIdEditable);
    dlvMode_ds.object(fieldnum(DlvMode, ShipCarrierId)).allowEdit(isAccountCodeAndIdEditable);
}

public RetailOperatingUnitPickerData getPickerInitParameters()
{
    // no need to pass already selected orgs so we just pass the hierarchy purpose as an init parameter for the picker.
    return RetailOperatingUnitPickerData::createInstance(HierarchyPurpose::RetailAssortment);
}

void processOperatingUnitPickerData(RetailOperatingUnitPickerData operatingUnitPickerData)
{
    Set _selectedOMInternalOrganizationIds = operatingUnitPickerData.omInternalOrganizationRecIds;

    RetailDlvModeChannelLine dlvModeChannelLine;
    RecordInsertList recordInsertList = new RecordInsertList(tableNum(RetailDlvModeChannelLine));

    if (_selectedOMInternalOrganizationIds.elements() > 0)
    {
        SetEnumerator enumerators = _selectedOMInternalOrganizationIds.getEnumerator();
        while (enumerators.moveNext())
        {
            dlvModeChannelLine.DlvMode = DlvMode.RecId;
            dlvModeChannelLine.omHierarchyType = operatingUnitPickerData.omHierarchyTypeRecId;
            dlvModeChannelLine.omInternalOrganization = enumerators.current();
            recordInsertList.add(dlvModeChannelLine);
        }

        recordInsertList.insertDatabase();
        DlvMode_ds.research(true);
    }

}

public int active()
{
    int ret;

    ret = super();
    element.enableFields();

    return ret;
}

public void modified()
{
    super();

    // Needed as modifiedField method on table changes field values.
    dlvmode_ds.refresh();
}

public void lookup(FormControl _formControl, str _filterStr)
{
    Query                   query;
    SysTableLookup          sysTableLookup;
    QueryBuildDataSource    queryBuildDataSourceView;

    query = new Query();
    sysTableLookup = SysTableLookup::newParameters(tableNum(LogisticsAddressCountryRegionNameView), _formControl);
    queryBuildDataSourceView = query.addDataSource(tableNum(LogisticsAddressCountryRegionNameView));
    queryBuildDataSourceView.addRange(fieldNum(LogisticsAddressCountryRegionNameView, LanguageId)).value(queryValue(currentUserLanguage()));

    sysTableLookup.addLookupfield(fieldNum(LogisticsAddressCountryRegionNameView, CountryRegionId));
    sysTableLookup.addLookupfield(fieldNum(LogisticsAddressCountryRegionNameView, ShortName));

    sysTableLookup.parmQuery(query);
    sysTableLookup.performFormLookup();
}

void clicked()
{
    FormRun         formRun;
    Args            args;
    MenuFunction    menuFunction;

    args = new Args();
    args.caller(element);
    args.record(DlvMode);
    menuFunction = new MenuFunction(menuitemDisplayStr(RetailAddProductsVariants), MenuItemType::Display);
    formRun = menuFunction.create(args);
    formRun.run();
    formRun.wait();
}
